import React, { useState } from "react"

function MoveHistory({move=undefined})
{
    const[moves,setMoves] = useState([])

    if(move !== undefined)
    {
        setMoves((moves)=>[...moves].push(move))
    }


    return <ol>
        {moves.length !==0 && moves.map((data)=>(
             <li>{data}</li>
        ))}
    </ol>
}

export default MoveHistory
